    /**
     * 返回etf的结果，已经按时间排序
     *
     * @return
     */
    public static List<EtfDO> getEtfList(String etf) {
        Type type = new TypeToken<List<EtfDO>>() {
        }.getType();
        List<EtfDO> result = JSON.parseObject(etf, type);
        Collections.sort(result, new Comparator<EtfDO>() {
            public int compare(EtfDO p1, EtfDO p2) {
                Date date1 = null;
                Date date2 = null;
                try {
                    date1 = sdf.parse(p1.getTradeDate());
                } catch (ParseException e) {
                    e.printStackTrace();
                }
                try {
                    date2 = sdf.parse(p2.getTradeDate());
                } catch (ParseException e) {
                    e.printStackTrace();
                }
                return date1.after(date2) ? 1 : 0;
            }
        });
        return result;
    }

